"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Glomerular disease (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/glomerular-disease-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H14390937\">",
"      <span class=\"h1\">",
"       What is glomerular disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Glomerular disease is a condition that affects the kidneys. The kidneys are organs in the urinary tract that make urine (",
"      <a class=\"graphic graphic_figure graphicRef79864 \" href=\"mobipreview.htm?26/28/27072\">",
"       figure 1",
"      </a>",
"      ). Each kidney has 2 parts:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A part that filters the blood and removes waste and excess salt and water",
"       </li>",
"       <li>",
"        A part that collects urine",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In glomerular disease, the part of the kidney that filters the blood doesn&rsquo;t work normally. As a result, substances that shouldn&rsquo;t be in the urine, such as blood and protein, can get into the urine.",
"     </p>",
"     <p>",
"      Glomerular disease can happen quickly or slowly over time. There are different types of glomerular disease, and each type has different causes.",
"     </p>",
"     <p>",
"      Sometimes glomerular disease causes serious problems. It can cause acute kidney failure, which is when the kidneys suddenly stop working. It can also cause chronic kidney disease, which is when the kidneys slowly stop working.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14390952\">",
"      <span class=\"h1\">",
"       What are the symptoms of glomerular disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms depend on the type of glomerular disease you have and what&rsquo;s causing it. Some people with glomerular disease have no symptoms. They find out they have it when their doctor does a urine test for another reason.",
"     </p>",
"     <p>",
"      When glomerular disease causes symptoms, they can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Bloody urine or urine that is red, pink, or brown",
"       </li>",
"       <li>",
"        Foamy-looking urine",
"       </li>",
"       <li>",
"        Swelling of the hands, face, feet, or belly",
"       </li>",
"       <li>",
"        Feeling tired",
"       </li>",
"       <li>",
"        Urinating less than usual",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14390967\">",
"      <span class=\"h1\">",
"       Is there a test for glomerular disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse can check for glomerular disease by doing blood and urine tests. These tests can show if your urine has blood or protein in it, and how well your kidneys are working.",
"     </p>",
"     <p>",
"      Your doctor or nurse will probably do other tests to find out which type of glomerular disease you have. These tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests to check for medical conditions that can cause glomerular disease",
"       </li>",
"       <li>",
"        An ultrasound of your kidney &ndash; An ultrasound is an imaging test that uses sound waves to create a picture of the kidney.",
"       </li>",
"       <li>",
"        A kidney biopsy &ndash; During a biopsy, the doctor will put a thin needle into your back and into your kidney. He or she will remove a tiny sample of tissue from the kidney. Then another doctor will look at the sample under a microscope.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14390982\">",
"      <span class=\"h1\">",
"       How is glomerular disease treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on your symptoms, what&rsquo;s causing your glomerular disease, and how quickly it happened.",
"     </p>",
"     <p>",
"      People with mild glomerular disease might not need treatment. But their doctor will do blood and urine tests over time to follow their condition.",
"     </p>",
"     <p>",
"      Some types of glomerular disease go away on their own. For instance, people can get glomerular disease after they have an infection in another part of their body. This type of glomerular disease usually goes away after the infection is treated.",
"     </p>",
"     <p>",
"      When glomerular disease does need to be treated, treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Medicines called steroids &ndash; These steroids are different from the ones athletes take to build muscle. These medicines can come as pills or go into a vein through a tube called an &ldquo;IV.&rdquo;",
"       </li>",
"       <li>",
"        Medicines that treat high blood pressure",
"       </li>",
"       <li>",
"        Medicines called &ldquo;diuretics&rdquo; that make people urinate a lot",
"       </li>",
"       <li>",
"        Plasmapheresis &ndash; For this treatment, a machine pumps blood from your body and filters out substances that are harming your kidney. Then the machine returns the blood to your body.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People whose kidneys have stopped working might need other treatment called &ldquo;renal replacement therapy.&rdquo; Renal replacement therapy includes 3 different treatments that can do the work of the kidneys. These treatments are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Hemodialysis &ndash; Hemodialysis is a procedure in which a machine pumps blood out of the body, filters it, and returns it to the body (",
"        <a class=\"graphic graphic_figure graphicRef56992 \" href=\"mobipreview.htm?0/5/93\">",
"         figure 2",
"        </a>",
"        ). People have hemodialysis at least 3 times a week.",
"       </li>",
"       <li>",
"        Peritoneal dialysis &ndash; Peritoneal dialysis is a procedure that people do at home every day. It involves piping a special fluid through a tube into the belly. This fluid collects waste and excess salt and water from the blood. Then the used fluid drains out of the belly (",
"        <a class=\"graphic graphic_figure graphicRef71539 \" href=\"mobipreview.htm?25/22/25952\">",
"         figure 3",
"        </a>",
"        ).",
"       </li>",
"       <li>",
"        Kidney transplant &ndash; A kidney transplant is surgery in which a doctor puts a healthy kidney in a person whose kidneys are diseased (",
"        <a class=\"graphic graphic_figure graphicRef59957 \" href=\"mobipreview.htm?36/59/37809\">",
"         figure 4",
"        </a>",
"        ).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H14390997\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
