" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Selecting a reperfusion strategy for acute ST elevation myocardial infarction",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?36/31/37369/contributors\">",
"     Authors",
"    </a>",
